import React from 'react';
import './Half.css';

import Shopper from '../assets/img/welcome_body/shopper.jpg';
import Seller from '../assets/img/welcome_body/seller.jpg';
function Half({ content }) {
    if (content)
        var img = Shopper;
    else var img = Seller;

    return <div className='bgImage' style={{ backgroundImage: `url(${Seller})` }}>
        {/* <img src={Shopper} alt="" style={{ width: "100%" }} /> */}
    </div>;
}

export default Half;
